import { createSlice } from "@reduxjs/toolkit";

const featureSlice = createSlice({
  name: "feature",
  initialState: { message: "" },
  reducers: {
    logMessage: (state) => {
      console.log("Button clicked!");
    },
  },
});

export const { logMessage } = featureSlice.actions;
export default featureSlice.reducer;
